import Post from "../post/post"


export default function posts() {
  return (
    <div className="posts">
   <Link className="link" to="/register">Register</Link><Post/>
    <Post/>
    <Post/>
    <Post/>
    <Post/>
    <Post/>
      
    </div>
  )
}
